42.Query:
ASK
{
SERVICE <http://pyravlos1.di.uoa.gr:8890/sparql>
{
<http://yago-knowledge.org/resource/River_Exe> ?p ?o.
?x rdf:type <http://yago-knowledge.org/resource/wordnet_bridge_102898711>.
?x rdf:label ?label.
}
SERVICE <http://pyravlos1.di.uoa.gr:8080/geoqa/Query>
{
?poi rdf:type osm:Parking .
?poi geo:hasGeometry ?geom . ?geom geo:asWKT ?wkt .
