WHERE { <http://yago-knowledge.org/resource/Ireland> geo:hasGeometry ?irelandGeom. ?irelandGeom geo:asWKT ?irelandGeomWKT. ?county gadmOnt:hasName ?countyName; geo:hasGeometry ?countyGeom. ?countyGeom geo:asWKT ?countyGeomWKT. FILTER(geof:sfWithin(?countyGeomWKT, ?irelandGeomWKT))
}

